var nEntries = keychainEntries.length;

log.message("nEntries=" + nEntries);

var i;
var applications = "";
for (i=0; i<nEntries; i++) {
	var keychainEntry = keychainEntries.item(i);
	log.message("keychainEntry=" + keychainEntry);
	var application = keychainEntry.getAttribute("application");
	applications += application + ", ";
}

var l = applications.length;
if (l > 2) applications = applications.substring(0, l-2);
